import React from 'react';
import s from './Footer.module.css';

function Footer() {
    return (
        <footer>
            <span>TigranMets</span>
            <span>ReactJs Samurai | fullStack developer | Tech Writer</span>
            <span>Yerevan, Armenia</span>
            <div className={s.socImages}>
                    <img className={s.socImage} src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/91/Octicons-mark-github.svg/2048px-Octicons-mark-github.svg.png" alt="github" />
                    <img className={s.socImage} src="https://www.facebook.com/images/fb_icon_325x325.png" alt="facebook" />
                    <img className={s.socImage} src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a5/Instagram_icon.png/1024px-Instagram_icon.png" alt="instagram" />
                    <img className={s.socImage} src="https://web.telegram.org/img/logo_share.png" alt="telegram" />
                    <img className={s.socImage} src="https://www.vectorico.com/download/social_media/youtube-icon.png" alt="yotube" />
                </div>
                
        </footer>
    );
}

export default Footer;
